def get_kth_char(k):
    n = 0
    while (n * (n + 1)) // 2 < k:
        n += 1

    # Position within the last incomplete iteration
    pos = k - ((n - 1) * n) // 2 - 1

    # Convert position to the corresponding character
    return chr((pos % 26) + ord('a'))

